import { BootstrapTable, TableHeaderColumn } from "react-bootstrap-table-next";
import React, { Component } from "react";
import pic from "../assets/img/haland.jpeg";
const products = [];

function addProducts(quantity) {
  const startId = products.length;
  for (let i = 0; i < quantity; i++) {
    const id = startId + i;
    products.push({
      id: id,
      pic: pic,
      name: "Erling Haaland",
      potential: 92,
      overall: 88,
      age: 20,
      price: 2100 + i,
    });
  }
}

addProducts(5);

class SearchPlayer extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <BootstrapTable columnFilter={true}>
        <TableHeaderColumn dataField="id" isKey={true}>
          Player ID
        </TableHeaderColumn>
        <TableHeaderColumn dataField="pic" isKey={false}>
          Player Photo
        </TableHeaderColumn>
        <TableHeaderColumn dataField="name">Player Name</TableHeaderColumn>
        <TableHeaderColumn dataField="potential"> Potential</TableHeaderColumn>
        <TableHeaderColumn dataField="overall"> Overall</TableHeaderColumn>
        <TableHeaderColumn dataField="age"> Age</TableHeaderColumn>
        <TableHeaderColumn dataField="price"> Age</TableHeaderColumn>
      </BootstrapTable>
    );
  }
}
export default SearchPlayer;
